interface Props {
  bookList: { no: number; authors: string[]; thumbnail: string; title: string; translators?: undefined }[]
}

export const RowBookList = ({ bookList }: Props) => {
  return (
    <div>
      {bookList.map((item) => (
        <div key={item.no}>{item.title}</div>
      ))}
    </div>
  )
}
